(5, 'Deus não está Morto', 'Quando o jovem Josh Wheaton (Shane Harper) entra na universidade, ele conhece um arrogante professor de filosofia (Kevin Sorbo) que não acredita em Deus. O aluno reafirma sua fé, e é desafiado pelo professor a comprovar a existência de Deus. Começa uma batalha entre os dois homens, que estão dispostos a tudo para justificar o seu ponto de vista - até se afastar das pessoas mais importantes para eles.', 'data:image/jpeg;base64,', 'sg_vry1jIKo', 2014, 'A');

