INSERT INTO `SITE_NOT_NOTICIAS` (`NOT_ID`, `USU_Cadastro_ID`, `USU_Alteracao_ID`, `NOT_Titulo`, `NOT_Texto`, `NOT_DataHoraCadastro`, `NOT_DataHoraAlteracao`, `NOT_FotoDestaque`, `NOT_DataExpiracao`) VALUES
(1, 1, 1, 'Parabéns Mamães', '<p>Bem sabemos que esse Dia n&Atilde;&pound;o se resume no hoje. &Atilde;&permil;s maior que um dia.&nbsp;&Atilde;&permil;s linda, protetora, am&Atilde;&iexcl;vel, amiga, solid&Atilde;&iexcl;ria, motivadora, &Atilde;&copy;s uma mulher de Deus.&nbsp;</p>\n<p>A PIBCC deseja um Dia Maravilhoso, um Dia em que Celebremos a Fam&Atilde;&shy;lia, o Amor. Um Dia cheio da Gra&Atilde;&sect;a do nosso amado Jesus Cristo.</p>\n<p>&nbsp;</p>\n<p><span class="f-img-wrap"><img style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; width: 444px; float: left;" src="http://pibcc.igrejaconectada.com/sig/modulos/site/comunicacao/uploads/noticias/38cf716dd10c1d78a645093b15e951e88a3f1bfe.jpg" alt="Image title" width="200" /></span></p>', '2014-05-11 11:05:18', '2014-10-23 10:29:43', NULL, '2014-11-01'),
(2, 1, 1, 'Estudo sobre "OS DONS ESPIRITUAIS"', '<p>DEUS QUER TE USAR!&nbsp;VocÃª jÃ¡ pensou sobre isso? Ele te salvou pra vocÃª servir, abenÃ§oar os outros.<span style="line-height: 14.399999618530273px;">&nbsp;</span></p><p><strong>DESCUBRA SEUS DONS ESPIRITUAIS E SEJA UMA BENÃ‡ÃƒO.</strong></p><p>Jesus: "...Eu vos escolhi, e vos nomeei, para que vades e DEIS FRUTOS". Jo 15.16</p><p>Paulo: "HÃ¡ diversidade de DONS, mas o EspÃ­rito Ã© o mesmo". I Co 12.4</p><p>&nbsp;</p><p><strong>Toda Quarta-feira - 19h30</strong></p><p><span class="f-img-wrap"><img alt="Image title" src="http://pibcc.igrejaconectada.com/sig/modulos/site/comunicacao/uploads/noticias/db9c60322623a53f0668ceae9b363ec576f991ca.jpg" width="200" style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left; width: 483px;" /></span>&nbsp;</p>', '2014-04-24 18:46:42', '2014-05-20 16:32:26', NULL, NULL),
(3, 1, 1, 'Jovem Evangelizador', '<p>Confira: Jovem Evangelizador ...&nbsp;</p><p>A palavra em Movimento</p><p><span class="f-img-wrap"><img alt="Image title" src="http://pibcc.igrejaconectada.com/sig/modulos/site/comunicacao/uploads/noticias/f344fae889ca1c726c3b49a4197d5dcd81595f57.jpg" width="200" style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left; width: 694px;" /></span></p>', '2014-04-24 18:49:10', '2014-05-20 16:21:35', NULL, NULL),
(4, 1, 1, 'Uma breve Reflexão: "O Trabalho"', '<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&acirc;&euro;&lsaquo;Como &Atilde;&copy; gostoso trabalhar. Sentimo-nos &Atilde;&ordm;teis, ativos, saud&Atilde;&iexcl;veis. O trabalho &Atilde;&copy; necess&Atilde;&iexcl;rio, pois dele tiramos nosso sustento, gastamos energia para ganhar outras, traz-nos dignidade, e at&Atilde;&copy; sentimos prazer. No entanto, alguns fazem do trabalho uma canseira, um enfado, e, nele, escravizam-se. Pois &Atilde;&copy;, alguns se tornam escravos do trabalho, e nada mais consegue realizar.</p>\n<p style="text-align: left;">Deus nos deu o trabalho, o suor, como recompensa a nossa desordem mental, comportamental, rebeldia. <strong>(Gn 3.17-23)</strong></p>\n<p style="text-align: left;">O trabalho, na verdade, tornou-se um recurso did&Atilde;&iexcl;tico de Deus aos homens, pois ao trabalhar, dever&Atilde;&shy;amos refletir a raz&Atilde;&pound;o de nos ter levado a isso.</p>\n<p style="text-align: left;">Por outro lado, o trabalho em si n&Atilde;&pound;o nos sustenta, haja vista a necessidade de se manter em Equil&Atilde;&shy;brio entre as coisas do Esp&Atilde;&shy;rito e as coisas do nosso Tempo. <strong>(Mt 6.33)</strong></p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;"><strong>Voc&Atilde;&ordf; J&Atilde;&iexcl; Orou Hoje?</strong></p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">Essa seria uma das atitudes mais Simples pra iniciar seu Dia antes de se entregar ao Trabalho.&nbsp;Busque o Equil&Atilde;&shy;brio e certamente voc&Atilde;&ordf; ficar&Atilde;&iexcl; mais forte. Pois come&Atilde;&sect;ar o Dia de Joelhos d&Atilde;&iexcl; menos trabalho.</p>\n<p style="text-align: left;"><strong><span style="font-size: 14px;" data-font="true">PENSE NISSO</span></strong><strong><span style="font-size: 14px;" data-font="true">!</span></strong></p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">Deus os aben&Atilde;&sect;oe.</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>\n<p style="text-align: left;">&nbsp;</p>', '2014-04-24 19:09:56', '2014-10-23 10:29:23', NULL, NULL);
INSERT INTO `SITE_NOT_NOTICIAS` (`NOT_ID`, `USU_Cadastro_ID`, `USU_Alteracao_ID`, `NOT_Titulo`, `NOT_Texto`, `NOT_DataHoraCadastro`, `NOT_DataHoraAlteracao`, `NOT_FotoDestaque`, `NOT_DataExpiracao`) VALUES
(5, 1, 1, '2º Aniversário da PIBCC', '<p style="text-align: left;"><span class="f-img-wrap"><img style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left;" src="http://pibcc.sigigreja.com.br/sig/modulos/site/comunicacao/uploads/noticias/1c23496d2fd6d68251173ec53cd8547b2ab3e9e3.jpg" alt="Image title" width="200" /></span><span class="f-img-wrap"><img style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left;" src="http://pibcc.sigigreja.com.br/sig/modulos/site/comunicacao/uploads/noticias/2b8208c76efe8a83dc099aa9716cb4db1f4dca68.jpg" alt="Image title" width="200" /></span><span class="f-img-wrap"><img style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left;" src="http://pibcc.sigigreja.com.br/sig/modulos/site/comunicacao/uploads/noticias/540c156e6bdead020181919eca6d2e4d1c269890.jpg" alt="Image title" width="200" /></span><span class="f-img-wrap" style="text-align: center;"><img style="min-width: 16px; min-height: 16px; margin: 10px 10px 10px 0px; float: left;" src="http://pibcc.sigigreja.com.br/sig/modulos/site/comunicacao/uploads/noticias/f8544da916d784d1e3e8feb261e17c22237ebfee.jpg" alt="Image title" width="200" /></span></p>\n<p>&acirc;&euro;&lsaquo;</p>\n<p>DOMINGO 18 | Maio | 2014</p>\n<p>Celebramos o 2&Acirc;&deg; Ano do Anivers&Atilde;&iexcl;rio da PiIBCC.</p>\n<p>Recebemos muitos irm&Atilde;&pound;os, seus familiares, e amigos.<br /> Nossa Igreja, que antes comportava apenas 80 pessoas, teve a grata alegria de recepcionar cerca de 230 pessoas com a Nova Reforma.</p>\n<p>Tema da Mensagem do dia:</p>\n<p>"02 Anos Anunciando Jesus, A Converg&Atilde;&ordf;ncia do Mundo a Deus" CL 1.13-20</p>', '2014-05-20 00:26:30', '2014-10-23 10:19:29', 'data:image/jpeg;base64,', NULL);
